        {
            int a, b;
            cin >> a >> b;
            int ans = LLONG_MIN;

            while(start[a] != start[b])
            {
                if(depth[start[a]] < depth[start[b]])
                {
                    swap(a, b);
                }

                ans = max(ans, st.query(tin[start[a]], tin[a]));
                a = parent[start[a]];
            }
            if(depth[a] < depth[b]) swap(a, b);

            ans = max(ans, st.query(tin[b], tin[a]));
            cout << ans << endl;
        }
    }
